import React, { Component } from 'react';
import {BrowserRouter as Router, Route, Link } from "react-router-dom";
import "bootstrap/dist/css/bootstrap.min.css";

// Importandando bibliotecas necessarias do WoT
import * as Core from '@node-wot/core';
import * as Http from '@node-wot/binding-http';
import * as WebSocket from '@node-wot/binding-websockets';


import Edit from "./components/edit.component";
import List from "./components/list.component";
import Read from "./components/read.component";
import Search from "./components/search.component";

import logo from "./logo.png";

export const WoT = {
  Core,
  Http,
  WebSocket
};

class App extends Component {

  componentDidMount() {

    const servient = new WoT.Core.Servient();
    servient.addClientFactory(new WoT.Http.HttpClientFactory());
    servient.addClientFactory(new WoT.WebSocket.WebSocketClientFactory());
    servient.addClientFactory(new WoT.WebSocket.WebSocketSecureClientFactory());
    servient.start().then(wot => {
        this.setState({ wot });
    });
  }

  render() {
    return (
      <Router>
        <div class="container">

          <div class="jumbotron blue-grey lighten-5" >
            <h2 class="card-title h1">Semantic Interoperability for Internet of Things</h2>
            <p class="indigo-text my-4 font-weight-bold">Testando coleta e representação de dados de um sensor</p>
          </div>

          <nav class="navbar navbar-expand-lg bg-dark navbar-dark">
            <a class="navbar-brand" href="/">
              <img src={logo} width="90" height="30" alt="logo" class="d-inline-block align-top"/>
            </a>
            <div class="collpase nav-collapse" >
              <ul class="navbar-nav ml-auto">
                <li class="navbar-item">
                  <Link to="/" class="nav-link">Listar URI's</Link>
                </li>
                <li class="navbar-item">
                  <Link to="/create" class="nav-link">Buscar TD</Link>
                </li>
              </ul>
            </div>
          </nav>

          <Route path="/" exact component={List} />
          <Route path="/edit/:id" component={Edit} />
          <Route path="/search" component={Search} />
          <Route path="/read/:id" component={Read} />
        </div>
      </Router>
    );
  }
}

export default App;
